import React from 'react';
import './App.css';

const movieData = [{
  id: 1,
  name: 'avengers',
  image: 'data:image/jpeg;base64,',
  rating: 5
},{
  id: 2,
  name: 'paracite',
  image: 'data:image/jpeg;base64,',
  rating: 5
},{
  id: 3,
  name: 'batman',
  image: 'https://images-na.ssl-images-amazon.com/images/I/71jzMH-kHQL._AC_SY741_.jpg',
  rating: 5
},{
  id: 4,
  name: 'joker',
  image: 'data:image/jpeg;base64,',
  rating: 5
}]

class MovieList extends React.Component {
  render(){
    return (
      <div>
        <h1>{this.props.name}</h1>
        <h3>{this.props.rating}</h3>
        <img src={this.props.image} alt={this.props.name}></img>
      </div>
    )
  }
} 
function App() {
  return (
    <div className="App">
      {movieData.map((movie)=>(
        <MovieList 
        key={movie.id}
        name={movie.name}
        rating={movie.rating}
        image={movie.image}/>
      ))}
    </div>
  );
}

export default App;
